
def minPathSum(matrix):
    # write code here
    n,m = len(matrix), len(matrix[0])
    print(n,m)
    dp = [[0]*m for _ in range(n)]

    for i in range(0,n):
        for j in range(0,m):
            if i == 0 and j==0:
                dp[i][j] = matrix[i][j]
            elif i == 0 and j!=0:
                dp[i][j] = matrix[i][j] + dp[i][j-1]
            elif i != 0 and j==0:
                dp[i][j] = matrix[i][j] + dp[i-1][j]
            else:
                dp[i][j] = matrix[i][j] + min(dp[i][j-1],dp[i-1][j])
    return dp[-1][-1]


